import React from 'react'
import './props.css'
import boxArr from './BOXARRAY/boxarry'
const Props = ({ id, className, cellNUM,arr}) => {
  let value = arr
  let player;
  if (value.Player1 === 'in') {
    player = <div>P1</div>
  }

  return (
    <div className='props'>
      {/* {player} */}
      
      <div id={id} className={className}><h1 className='numtitle' >{cellNUM}</h1></div>
    </div>
  )
}

export default Props
